In Swift, you can create a similar class using `CALayer` and `UIImage` instead of `LayerDrawable` and `Drawable`. Here's a basic example:

```swift
import UIKit

class StackedLayers {
    private var layers: [CALayer] = []
    private let iconScale: CGFloat = 0.7

    init(layers: [UIImage], iconScale: CGFloat = 0.7) {
        self.layers = layers.map { CALayer() }
        self.iconScale = iconScale
    }

    func placeIcons(in view: UIView) {
        let newWidth = view.bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) - 1

        for (index, layer) in layers.enumerated() {
            layer.bounds = CGRect(x: 0, y: 0, width: iconsSize, height: iconsSize)
            layer.position = CGPoint(x: view.bounds.midX, y: view.bounds.midY)
            layer.cornerRadius = iconsSize / 2
            layer.masksToBounds = true

            switch index {
            case 1:
                layer.frame = CGRect(x: 0, y: iconsInset, width: iconsSize, height: iconsSize)
            case 0:
                layer.frame = CGRect(x: iconsInset, y: 0, width: iconsSize, height: iconsSize)
            default:
                break
            }

            view.layer.addSublayer(layer)
            if index < layers.count - 1 {
                layer.sendSublayerToBack(layers[index + 1])
            }
        }
    }
}
```

