Here's a function that takes a `date` (a `Date` object) representing the post's creation time and returns the elapsed time since the post was made in a human-readable format:

```typescript
function timeSince(date: Date): string {
  const seconds = Math.floor((new Date().getTime() - date.getTime()) / 1000);

  let interval = seconds / 60;
  let time = '';

  if (interval < 1) {
    time = `${Math.floor(seconds)} seconds ago`;
  } else if (interval < 60) {
    time = `${Math.floor(interval)} minutes ago`;
  } else if (interval < 1440) {
    time = `${Math.floor(interval / 60)} hours ago`;
  } else if (interval < 10080) {
    time = `${Math.floor(interval / 1440)} days ago`;
  } else {
    time = `${Math.floor(interval / 10080)} weeks ago`;
  }

  return time;
}
```

